import React,{ useState } from 'react';
import './App.css';
import Login from './Login';
import { login } from './services';

function App() {
  const [user, setUser] = useState("");

  const onLogin = (user) => {
		login({user})
		.then( data => {
		  setUser(user);
		})
		.catch( err => {
			console.warn('error in user Login');
		});
	};

  return (
    <div className="App">
      <Login onLogin={onLogin}/>
    </div>
  );
}

export default App;
